function getStorageWithExpiration(key: string) {
  const itemStr = localStorage.getItem(key)

  // 检查是否存在对应的值
  if (!itemStr) {
    return null
  }
  let item = { expiry: 1, value: '' }
  try {
    item = JSON.parse(itemStr)
  } catch {
    item = { expiry: 1, value: '' }
  }
  const now = new Date()
  // 检查是否过期
  if (now.getTime() > item.expiry) {
    sessionStorage.removeItem(key)
    return null
  }
  return item.value
}
